$ser_content = 'a:2:{s:7:"CONTENT";s:0:"";s:4:"VARS";a:3:{i:23506;a:24:{s:2:"ID";s:5:"23506";s:11:"ACTIVE_FROM";s:22:"12 октября 2014";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:10:"Елена";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23506:21";s:20:"PROPERTY_EMAIL_VALUE";s:15:"bairov@sbor.net";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23506:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23506:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:1314:"Я пациентка 1994/1995 г., моим девчонкам в этом году исполнится 19, мы родом из вашей клиники. Открыла сайт, а тут все те же лица врачей, которые всю жизнь посвятили тому, чтобы тысячи семей сделать счастливыми. В далеком 1995  статистика была не такой обнадеживающей, только врачи внушали веру в успех. У меня было две попытки и после второй появились две девочки, долго не могла ничего им рассказать об их появлении и только сейчас, когда они стали взрослыми поговорили об этом. В 2007 году был снят документальный фильм &quot;Дети из пробирки&quot;, там я увидела и своих детей на празднике в честь рождения клиники. Тем кто приходит на этот сайт хочу пожелать не откладывать проблему, здесь работают настоящие специалисты, доверяйте им. ";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23506:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23506:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23506:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23506:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23506:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23470;a:24:{s:2:"ID";s:5:"23470";s:11:"ACTIVE_FROM";s:15:"8 июня 2014";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:18:"Маргарита";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23470:21";s:20:"PROP